import React from 'react';
import { Link } from 'react-router-dom';
import { Nav, Navbar, Alert, NavItem } from 'react-bootstrap';



export const NavigationBar = () => (
<>
    <Navbar bg="dark" variant="dark">
        <Navbar.Brand href="/">Patrick Leduc</Navbar.Brand>
        <Nav className="mr-auto">
            <NavItem componentClass={Link} href="/experience">Experience</NavItem>
            <NavItem componentClass={Link} href="/projects">Projects</NavItem>
            <NavItem componentClass={Link} href="/education">Education</NavItem>
            <NavItem componentClass={Link} href="/contact">Contact</NavItem>
            <NavItem componentClass={Link} href="/blog">Blog</NavItem>
        </Nav>
    </Navbar>
    <Alert variant="primary">
        <p> This website runs on a Kubernetes Cluster! </p>
    </Alert>
</>
);
